@westlakevillageinn is a beautiful luxury hotel, hidden halfway between Santa Barbara and Los Angeles. With over 17-acres of lush green landscape, this village inn is the perfect place for a relaxing getaway. Whether you’re enjoying a self-care day at their @sparelaiswestlakevillageinn or experiencing wine tasting at their own private vineyard, @thestonehaus, your stay will be one to remember. ✨

Thank you @westlakevillageinn for hosting us!

Via @tastemadetravel ✈️
